import Base from "../components/Base";
import {
  Button,
  Card,
  CardBody,
  CardHeader,
  Col,
  Container,
  Form,
  FormGroup,
  Input,
  Label,
  Row,
} from "reactstrap";

const Signup = () => {
  return (
    <Base>
      <Container>
    <Row>
		<Col sm={{size:6, offset:3}}>
		</Col>
	</Row>
      </Container>
    </Base>
  );
};

export default Signup;
